bool isRotationallyEqual(const string& a, const string& b) {
    for (int i = 0; i < 4; ++i) {
        if (a == b) return true;
        rotate(a.begin(), a.begin() + 1, a.end());
    }
    return false;
}

bool isRotationallySymmetric(const string& a) {
    for (int i = 0; i < 4; ++i) {
        if (a == string(a.rbegin(), a.rend())) return true;
        rotate(a.begin(), a.begin() + 1, a.end());
    }
    return false;
}

int countSolutions(const vector<string>& puzzle) {
    int count = 0;
    do {
        bool valid = true;
        for (int i = 0; i < 9; ++i) {
            for (int j = i + 1; j < 9; ++j) {
                if (i / 3 != j / 3 && j % 3 != i % 3) {
                    if (puzzle[i] == puzzle[j] || isRotationallyEqual(puzzle[i], puzzle[j])) {
                        valid = false;
                        break;
                    }
                }
            }
        }
        if (valid) {
            for (int i = 0; i < 9; ++i) {
                if (isRotationallySymmetric(puzzle[i])) {
                    valid = false;
                    break;
                }
            }
        }
        if (valid) count++;
    } while (next_permutation(puzzle.begin(), puzzle.end()));
    return count;
}

